import React from "react";
import styled from "styled-components";

const MainBox = styled.div`
    
`
const CardBox = styled.div`
    width: 490px;
  height: 450px;
  background-color: gray;
  border-radius:5px;
`
const CardTitle = styled.p`
    font-size: 25px;
  font-weight: 300;
  color: white;
  position: absolute;
  margin-top: 150px;
  margin-left: 180px;
`
const ContentBox = styled.div`
    width: 490px;
    height:100px;
    background-color: blue;
    border-radius:5px;
    position: relative;
   margin-top: 100px;
`
const CardContent = styled.p`
    font-size: 20px;
  font-weight: 200;
  
`

const Main = (props) =>{
    return(
        <>
        <MainBox>
            <CardBox>
                <ContentBox>
                <CardTitle>{props.cardTitle}</CardTitle>
                <CardContent>{props.cardContent}</CardContent>
                </ContentBox>
            </CardBox>
        </MainBox>
        </>
    )
}
export default Main;
